    super.key,
    required this.bancoOri,
    required this.cuenta,
    required this.cuentaOri,
    required this.cuentaPro,
    required this.desFon,
    required this.fechaDepo,
    required this.moneda,
    required this.monto,
    required this.nameDepo,
